import React,{Component} from 'react';


class BillView extends Component
{
    render() {
        return(
            <div style={title}>
                <h2>Receipt</h2>
                <div style={body}>
                    <table style={tableStyle}>
                        <tbody>
                          <tr style={cellStyle}>
                              <td>
                                  <label>From</label>
                              </td>
                          </tr>
                          <tr tyle={cellStyle}>
                              <td>
                                  <label>To</label>
                              </td>
                          </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        );

    }
}
const title={
    textAlign:"center"
};
const body={
   fontSize:"30px",
   left:"1200px",
    right:"1200px"
};
const tableStyle={
    width:"500px",
    marginLeft:'10%',
    marginRight:'10%'
};

const cellStyle={
    height:'50px'
};

export default BillView
